#! /usr/bin/env python
# -*- coding: utf-8 -*-

from PySide6.QtCore import Qt, QByteArray
from PySide6.QtGui import QIcon, QPixmap
from PySide6.QtWidgets import QWidget, QPushButton, QLineEdit, \
    QApplication, QVBoxLayout, QMessageBox, QListWidget, \
    QHBoxLayout

TUBIAO_windows = ""
TUBIAO_search_button = b''
TUBIAO_clear_button = b''
TUBIAO_copy_button = b''

class CommandOutputWindow(QWidget):
    # 命令输出界面窗口
    def __init__(self):
        super().__init__()

        # 创建调试页面的UI
        self.init_ui()
        self.setWindowTitle("命令输出窗口 - by bilibili爱吃肉的呆头猪")

        # 设置窗口图标
        icon_data = bytes.fromhex(TUBIAO_windows)
        pixmap_windows = QPixmap()
        pixmap_windows.loadFromData(icon_data)
        self.setWindowIcon(QIcon(pixmap_windows))

        self.current_search_index = -1

    def init_ui(self):
        layout = QVBoxLayout()

        # 创建列表组件
        self.list_widget = QListWidget()
        self.list_widget.setSelectionMode(QListWidget.SelectionMode.ExtendedSelection)  # 设置多选模式
        layout.addWidget(self.list_widget)

        # 创建按钮和文本框
        search_layout = QHBoxLayout()
        self.search_input = QLineEdit()
        self.search_input.setPlaceholderText("请输入要搜索的内容")

        pixmap_command_search = QPixmap()
        pixmap_command_search.loadFromData(QByteArray.fromHex(TUBIAO_search_button))
        self.search_button = QPushButton("查找")
        self.search_button.setIcon(QIcon(pixmap_command_search))

        pixmap_command_clear = QPixmap()
        pixmap_command_clear.loadFromData(QByteArray.fromHex(TUBIAO_clear_button))
        self.clear_button = QPushButton("清空")
        self.clear_button.setIcon(QIcon(pixmap_command_clear))

        pixmap_copy_button = QPixmap()
        pixmap_copy_button.loadFromData(QByteArray.fromHex(TUBIAO_copy_button))
        self.copy_button = QPushButton("复制")
        self.copy_button.setIcon(QIcon(pixmap_copy_button))

        search_layout.addWidget(self.search_input)
        search_layout.addWidget(self.search_button)
        search_layout.addWidget(self.clear_button)
        search_layout.addWidget(self.copy_button)

        layout.addLayout(search_layout)

        # 设置布局
        self.setLayout(layout)

        # 按钮事件
        self.search_button.clicked.connect(self.searchText)
        self.clear_button.clicked.connect(self.clearOutputDialog)
        self.copy_button.clicked.connect(self.copy_selected_items)

    def toggle_top(self, checked):
        if checked:
            self.setWindowFlag(Qt.WindowType.WindowStaysOnTopHint)
        else:
            self.setWindowFlag(Qt.WindowType.WindowStaysOnTopHint, False)
        self.show()

    def updateOutput(self, text):
        self.list_widget.addItem(text)
        self.list_widget.scrollToBottom()

    def searchText(self):
        text_to_find = self.search_input.text()
        items = self.list_widget.findItems(text_to_find, Qt.MatchFlag.MatchContains)

        if items:
            self.current_search_index += 1
            if self.current_search_index >= len(items):
                self.current_search_index = 0
            item = items[self.current_search_index]

            row = self.list_widget.row(item)
            self.list_widget.setCurrentRow(row)
        else:
            QMessageBox.warning(self, "未找到匹配项", "没有找到与输入内容匹配的项。")
            self.current_search_index = -1

    def clearOutputDialog(self):
        reply = QMessageBox.question(self, '确认清空', '是否要清空内容？',
                                     QMessageBox.StandardButton.Yes | QMessageBox.StandardButton.No,
                                     QMessageBox.StandardButton.No)

        if reply == QMessageBox.StandardButton.Yes:
            self.clearOutput()

    def clearOutput(self):
        self.list_widget.clear()

    def copy_selected_items(self):
        selected_items = self.list_widget.selectedItems()
        if selected_items:
            clipboard = QApplication.clipboard()
            text = "\n".join(item.text() for item in selected_items)
            clipboard.setText(text)
            QMessageBox.information(self, "复制成功", "已复制选定项到剪贴板！")
